g(`\u540d\u5b57\uff1a${name}`); // \u8f93\u51fa\uff1a'\u540d\u5b57\uff1aAlice'",pt=e("https://www.typescriptlang.org/play/?experimentalDecorators=true&jsx=0&module=0&ts=5.7.3&filetype=ts#code/PTAEi45UEEHMFNSBiVUA5AhgWwYLO1CScoK8C9BvH0Gj1QGH-B--wAkAN7JOAAX3eAEo3GAdl9Zt9mrNONdbvc4E8Xh9Rr8-n0sCDwcpIdtoRiFstVkA"),dt="// \u4e3a\u4ee3\u8868\u4e00\u4e2a\u4eba\u7684\u5bf9\u8c61\u7ed3\u6784\u5b9a\u4e49\u4e00\u4e2a\u7c7b\u578b\u522b\u540d Person \ntype Person = { \n  firstName: string; \n  lastName: string; \n  age: number; \n}; \n\n// \u521b\u5efa\u4e00\u4e2a\u7c7b\u578b\u4e3a Person \u7684\u53d8\u91cf person \u5e76\u521d\u59cb\u5316 \nlet person: Person = { \n  firstName: 'John', \n  lastName: 'Doe', \n  age: 30, \n}; \n\n// \u8f93\u51fa person \u5bf9\u8c61\u4ee5\u793a\u8303\u5176\u7ed3\u6784 \nconsole.log('\u4eba\u7269:', person); // \u8f93\u51fa\uff1a'\u4eba\u7269:', { 'firstName': 'John', 'lastName': 'Doe', 'age': 30 }",mt=e("https://www.typescriptlang.org/play/?experimentalDecorators=true&jsx=0&module=0&ts=5.7.3&filetype=ts#code/PTAEi45RjuUCwjAA5QqOUF1ygQt0J--vL4zKRtBRKWzTHSdHp9QZtYYqVpteGTabIuYY0BLUCBIA"),xt="// \u5b9a\u4e49\u4e00\u4e2a\u7c7b\u578b\u522b\u540d ID\uff0c\u53ef\u4ee5\u662f\u5b57\u7b26\u4e32\u6216\u6570\u5b57 \ntype ID = string | number; \n\n// \u4e3a\u4e00\u4e2a2D\u5750\u6807\u5b9a\u4e49\u4e00\u4e2a\u7c7b\u578b\u522b\u540d Point\uff0c\u5305\u542b x \u548c y \u503c \ntype Point = { \n  x: number; \n  y: number; \n}; \n\n// \u5b9a\u4e49\u4e00\u4e2a\u7c7b\u578b\u522b\u540d PointWithLabel\uff0c\u5b83\u6269\u5c55\u4e86 Point\uff0c\u589e\u52a0\u4e86\u4e00\u4e2a label \u5c5e\u6027 \ntype PointWithLabel = Point & { label: string }; \n\n// \u8fd9\u4e9b\u7c7b\u578b\u7684\u4f7f\u7528 \n\n// \u4f7f\u7528 ID \u7c7b\u578b\u4f5c\u4e3a\u6570\u5b57\u6807\u8bc6\u7b26 \nlet userId: ID = 1023; \n\n// \u4f7f\u7528 ID \u7c7b\u578b\u4f5c\u4e3a\u5b57\u7b26\u4e32\u6807\u8bc6\u7b26 \nlet orderId: ID = 'order_456'; \n\n// \u521b\u5efa\u4e00\u4e2a Point \nlet origin: Point = { x: 0, y: 0 }; \n\n// \u521b\u5efa\u4e00\u4e2a PointWithLabel \nlet labeledPoint: PointWithLabel = { x: 10, y: 20, label: '\u4e00\u4e2a\u5e26\u6807\u7b7e\u7684\u70b9' }; \n\n// \u8f93\u51fa\u4ee5\u793a\u8303\u4f7f\u7528 \nconsole.log('\u7528\u6237 ID:', userId); // \u8f93\u51fa\uff1a'\u7528\u6237 ID:', 1023 \nconsole.log('\u8ba2\u5355 ID:', orderId); // \u8f93\u51fa\uff1a'\u8ba2\u5355 ID:', 'order_456' \nconsole.log('\u539f\u70b9\u5750\u6807:', origin); // \u8f93\u51fa\uff1a'\u539f\u70b9\u5750\u6807:', { 'x': 0, 'y': 0 } \nconsole.log('\u5e26\u6807\u7b7e\u7684\u70b9:', labeledPoint); // \u8f93\u51fa\uff1a'\u5e26\u6807\u7b7e\u7684\u70b9:', { 'x': 10, 'y': 20, 'label': '\u4e00\u4e2a\u5e26\u6807\u7b7e\u7684\u70b9' }",_t=e("https://www.typescriptlang.org/play/?experimentalDecorators=true&jsx=0&module=0&ts=5.7.3&filetype=ts#code/PTAEiztRJOUADlCo5RvH0NHqhqJULAqoCSARQMP+HvlQU7lB6M0HVtQMm9AmOUDQjQB1MTQAoAFwE8AHAU0y1AF5QAzkwBOASwB2Ac1AAfUOICuAWwBGHYQG5GDEKEBccnABMWQArqgcAsocJGlAAFAPYSmOQKDKgahVQAD1CAYlVAtQQB4FRlZOO0dxJj5QAG9GUC8ALnllNU14-2TFVXUtBgBfPJ0wSwQUdAcnAHVRJgALABkAQzUAGxxAYO1ASyNAVR1AMLlwpxxAPI1AAqU+uFBWlo5W0EA9HUByAxD2LkrImvrmtuj1qIAyWKmZ1uShMSlQQu1dQE34wGy5JEAQt0B-eUAKVxuwd+5QJEAdeT0dDMgDHosiMVocKIKATqDAAE2S2GiAEYAAyGADMRV03yR-z05AoILBDAhUXswjhsIRP34AHIKVThAB9AAsAFYAGx07FgQDYSoAvvUme3BkNAFNEkgkyRF-DinmSqIANJlQKirrzQILhREmJtGidRVFpm0OHC9jLdfrtrNovLkmiVSxkoZlcc2sk6XBAGR6ZkAft5PQCdDnSNZ9QIBk+MAX4oEQBcnoBgYO+DAAxvZxAJ7BCAHSteySAAUdLegHYjbiJOkq6HUgCUWl0UcAWP+FkvYMsqtGYxgptMZjjZ3MFwBF0YBVZVL5fFlOrtbADbpw9HKoZE5ZHO5ndT6azOfzdMA+cqB8yt8eSiQ10B1yONvcHsdxOmeOmKhcsB9qq5r7ub-t030BwOHk2zGaeynuejY-kGh63veDpunSz4urBAGtC+XqwOBwZXEAA"),Bt="// \u4e3a\u4e00\u4e2a\u63a5\u6536\u4e24\u4e2a\u6570\u5b57\u5e76\u8fd4\u56de\u4e00\u4e2a\u6570\u5b57\u7684\u51fd\u6570\u5b9a\u4e49\u4e00\u4e2a\u7c7b\u578b\u522b\u540d MathFunction \ntype MathFunction = (x: number, y: number) => number; \n\n// \u521b\u5efa\u4e00\u4e2a\u7c7b\u578b\u4e3a MathFunction \u7684\u53d8\u91cf add\uff0c\u5e76\u8d4b\u503c\u4e3a\u4e